import { createApp } from 'vue';
import App from './App.vue'; // Adjust the path based on your file structure
import DisplayData from './components/DisplayData.vue'; // Adjust the path as needed

// Create the Vue Router instance and define routes
import { createRouter, createWebHistory } from 'vue-router';
const router = createRouter({
  history: createWebHistory(),
  routes: [
    { path: '/', component: App },
    { path: '/display-data', component: DisplayData }
  ]
});

// Create the Vue app instance and mount it to the DOM
const app = createApp(App);
app.use(router);
app.mount('#app');
